import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DogList = () => {
  const [dogs, setDogs] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDogs = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/dogs');
        setDogs(response.data);
        setError(null);
      } catch (error) {
        console.error('Error fetching dogs data:', error);
        setError('Error fetching dogs data');
      }
    };

    fetchDogs();

  }, []); // El array vacío [] indica que este efecto se ejecuta solo una vez al montar el componente

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div className="dog-list">
      <h1>List of Dogs</h1>
      <ul>
        {dogs.map((dog) => (
          <li key={dog._id}>{dog.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default DogList;
